import React from "react";
import { Link } from "react-router-dom";
import { ContentHeader, PortfolioData } from "config/C4";

const PortfolioFilter = () => {
  return (
    <div className="portfolioView__filter">
      <h1>Filter</h1>
    </div>
  )
}

const PortfolioView = () => {
  return (
    <div className="portfolioView">
      <ContentHeader title="Portfolio" />
      <PortfolioFilter />
      <div className="portfolioView__items">
        {PortfolioData &&
          PortfolioData.map((item, i) => (
            <Link to={`/portfolio-item/${item.slug}`} className="portfolioView__items--item" key={i}>
              {item.slug === "studio-pixels-and-code" || item.slug === 'ingrid-yasuda' ? (
                <img
                  src={
                    require(`../../assets/images/portfolio/${item.slug}-thumb.png`)
                      .default
                  }
                  alt={item.name}
                />
              ) : (
                <img
                  src={
                    require(`../../assets/images/portfolio/studio-pixels-and-code-thumb.png`)
                      .default
                  }
                  alt={item.name}
                />
              )}
            </Link>
          ))}
      </div>
    </div>
  );
};

export default PortfolioView;
